          "title": "NoSQL là gì? (Bài 1.2)",
          "slug": "nosql-la-gi?-(bai-1.2)",
          "description": "NoSQL là một thế hệ cơ sở dữ liệu non-relational (không ràng buộc), distributed (phân tán), open source (mã nguồn mở), horizontal scalable (khả năng mở rộng theo chiều ngang). Nó có thể lưu trữ và xử lý dữ liệu từ một lượng rất nhỏ cho tới hàng petabytes chứa trong hệ thống. NoSQL có độ chịu tải và chịu lỗi cao với những yêu cầu về tài nguyên phần cứng thấp.",
