          "slug": "lich-su-phat-trien-cua-nosql-(bai-1.3)",
          "description": "Lịch sử phát triển của NoSQL\n\n- Thuật ngữ NoSQL được giới thiệu lần đầu vào năm 1998 sử dụng làm tên gọi chung cho các hệ CSDL quan hệ mã nguồn mở nhỏ không sử dụng SQL để truy vấn. (lightweight open source relational database)\n\n- Vào năm 2009, Eric Evans, nhân viên của Rackspace giới thiệu lại thuật ngữ NoSQL khi Johan Oskarsson của Last.fm muốn tổ chức một hội thảo về cơ sở dữ liệu mã nguồn mở phân tán. Thuật ngữ NoSQL đánh dấu bước phát triển của thế hệ CSDL mới: phân tán (distributed) + không ràng buộc (non-relational).\n\n- NoSQL storage đặc biệt thông dụng trong thời kỳ Web 2.0 bùng nổ, nơi các mạng dịch vụ dữ liệu cộng đồng (một cách gọi khác là mạng xã hội) cho phép người dùng tạo hàng tỷ nội dung trên 1 web.",
